        const getAsync = async function(){
            await new Promise((resolve) => {
                console.log('10010')
            });
            await new Promise((resolve) => {
                console.log('20020')
            });
        }

        console.log("djjdjjdjd", getAsync().then(res => {
            console.log(res)
        }))
    }

    render(){
        return(
            <div className="header-box">
                div
            </div>
        )
    }
}
